import Link from 'next/link';
import { FaArrowDown } from "react-icons/fa";



const Footer = props => {

    return (
        <footer className="footer">
            <section className="section__navlink">
                <Link href="/projects">
                    <a><FaArrowDown className="navlink--next"/></a>
                </Link>
            </section>
        </footer>
    );
}


export default Footer;
